import React from 'react';
import ImageButton from '../atoms/imageButton';
import './sidebar.css';
import Img from '../../resource/image/friendIcon.png';

function Header() : any {
  const ImageCss = {}
  return (
    <div className="sidebar">
      <ImageButton imageSrc={Img} alt={'친구'}/>
    </div>
  );
}

export default Header;
